def solve(lst):
    counts = {}
    for item in lst:
        if item not in counts:
            counts[item] = 1
        else:
            counts[item] += 1

    max_count = 0
    max_item = None
    for item, count in counts.items():
        if count > max_count:
            max_count = count
            max_item = item

    return max_item
